import React from 'react';
import './Header.css'; // Подключаем стили для Header

const Header = () => {
  return (
    <header className="header">
      <nav className="nav">
        <button className="nav-button">Главная</button>
        <button className="nav-button">О клубе</button>
        <button className="nav-button">Мероприятия</button>
        <button className="nav-button">Форум</button>
        <button className="nav-button">Контакты</button>
      </nav>
    </header>
  );
};

export default Header;
